INSERT INTO `xman_article` VALUES ('12', '震撼超高清风景航拍摄影演示视频 - 惊人 4K / 8K / 12K 分辨率测试视频下载', '4', '&lt;p&gt;现在 4K 视频已经很常见了，异次元也曾发布过一篇关于《&lt;a href=&quot;https://www.iplaysoft.com/play-4k-movie.html&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;电脑怎样播放 4K HDR 蓝光电影&lt;/a&gt;》的&lt;a href=&quot;https://www.iplaysoft.com/tag/%E6%95%99%E7%A8%8B&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;教程&lt;/a&gt;，追求最高画质的&lt;a href=&quot;https://www.iplaysoft.com/tag/%E7%94%B5%E5%BD%B1&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;电影&lt;/a&gt;爱好者们应该对 4K 都相当熟悉了。&lt;/p&gt;&lt;p&gt;然而这边&amp;nbsp;&lt;a href=&quot;https://www.iplaysoft.com/tag/4k&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;4K&lt;/a&gt;&amp;nbsp;才还刚开始普及，网上就陆续出现更清晰、更高分辨率的&lt;a href=&quot;https://www.iplaysoft.com/tag/%E8%A7%86%E9%A2%91&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;视频&lt;/a&gt;——比如 5K、8K 甚至是相当夸张的&amp;nbsp;&lt;strong&gt;12K 超高清视频&lt;/strong&gt;！如果你的电脑、&lt;a href=&quot;https://www.iplaysoft.com/tag/%E6%89%8B%E6%9C%BA&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;手机&lt;/a&gt;、&lt;a href=&quot;https://www.iplaysoft.com/go/tv&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;电视&lt;/a&gt;、盒子、播放机可以流畅播放4K，不妨也下载这些 8K 或 12K 的视频来试试你手头设备的播放解码能力吧……&lt;/p&gt;&lt;h3&gt;8K / 12K 分辨率超高清测试视频&lt;/h3&gt;&lt;div&gt;&lt;/div&gt;&lt;div class=&quot;clear&quot;&gt;&lt;/div&gt;&lt;p&gt;这里收录了多部 4K、5K、8K 和 12K 分辨率的超高清航拍&lt;a href=&quot;https://www.iplaysoft.com/tag/%E9%A3%8E%E6%99%AF&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;风景&lt;/a&gt;测试视频。很多都是由&amp;nbsp;&lt;a href=&quot;https://www.iplaysoft.com/go/dji&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;DJI 大疆无人机&lt;/a&gt;&amp;nbsp;拍摄于 2017 - 2018 日本、美国等地，风光景色相当唯美，画质优秀，时长大概每部 3 分钟，适用于店面展示，或&lt;a href=&quot;https://www.iplaysoft.com/tag/%E6%B5%8B%E8%AF%95&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;测试&lt;/a&gt;各种电脑、手机、电视盒子或&lt;a href=&quot;https://www.iplaysoft.com/tag/%E6%92%AD%E6%94%BE%E5%99%A8&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;播放器软件&lt;/a&gt;的性能及解码能力。&lt;/p&gt;&lt;p&gt;&lt;img class=&quot;aligncenter size-medium&quot; src=&quot;https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/12k_manhattan_newyork.jpg&quot; srcset=&quot;https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/12k_manhattan_newyork.jpg 1x,https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/12k_manhattan_newyork_2x.jpg 2x&quot; alt=&quot;纽约曼哈顿 12K 高清视频&quot; width=&quot;680&quot; height=&quot;382&quot; style=&quot;text-align: center;&quot;&gt;&lt;/p&gt;&lt;p&gt;这些超高清测试视频均是「&lt;a href=&quot;https://www.iplaysoft.com/go/fq&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;番·羽·土·啬&lt;/a&gt;」后搬运自 YouTube 的，由网友&lt;a href=&quot;http://bbs.feng.com/home.php?mod=space&amp;amp;uid=6673609&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;河东村&lt;/a&gt;整理，文件格式为 webp，大小普遍 300MB~1GB 左右，最高分辨率为 7680x4320，在&amp;nbsp;&lt;a href=&quot;https://www.iplaysoft.com/go/4k&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;4K 电视&lt;/a&gt;或大尺寸的&amp;nbsp;&lt;a href=&quot;https://www.iplaysoft.com/go/4kmonitor&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;4K 显示器&lt;/a&gt;下效果非常震撼，视频画面清晰锐利，细节相当丰富！&lt;/p&gt;&lt;p&gt;&lt;img class=&quot;aligncenter size-medium&quot; src=&quot;https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/5k_arizona.jpg&quot; srcset=&quot;https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/5k_arizona.jpg 1x,https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/5k_arizona_2x.jpg 2x&quot; alt=&quot;5K 高清视频&quot; width=&quot;680&quot; height=&quot;382&quot; style=&quot;text-align: center;&quot;&gt;&lt;/p&gt;&lt;p&gt;不过由于&amp;nbsp;WebP 是主要用于在线流媒体的&lt;a href=&quot;https://www.iplaysoft.com/tag/%E6%A0%BC%E5%BC%8F&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;格式&lt;/a&gt;，一般会经过压缩，所以视频码率不算太高，算不上极限画质测试，但优点胜在文件体积小巧，&lt;a href=&quot;https://www.iplaysoft.com/tag/%E4%B8%8B%E8%BD%BD&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;下载&lt;/a&gt;、保存、传输都比较方便。用来测试日常使用的电子设备的回放解码能力还是可以的。&lt;/p&gt;&lt;p&gt;&lt;img class=&quot;aligncenter size-medium&quot; src=&quot;https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/japan_in_8k.jpg&quot; srcset=&quot;https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/japan_in_8k.jpg 1x,https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/japan_in_8k_2x.jpg 2x&quot; alt=&quot;8K高清视频&quot; width=&quot;680&quot; height=&quot;382&quot; style=&quot;text-align: center;&quot;&gt;&lt;/p&gt;&lt;h3&gt;实际播放测试&lt;/h3&gt;&lt;p&gt;经站长实际测试，使用&amp;nbsp;&lt;a href=&quot;https://www.iplaysoft.com/go/mac&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;MacBook Pro 2017&lt;/a&gt;&amp;nbsp;+&amp;nbsp;&lt;a href=&quot;https://www.iplaysoft.com/iina.html&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;IINA 播放器&lt;/a&gt;，全部 4K~12K 视频均能流畅播放，没有任何鸭梨。而 Windows 系统下，则推荐使用&amp;nbsp;&lt;a href=&quot;https://www.iplaysoft.com/potplayer.html&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;PotPlayer&lt;/a&gt;。另外，不安装第三方播放器的情况下，WebP 视频用&amp;nbsp;&lt;a href=&quot;https://www.iplaysoft.com/google-chrome.html&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;Chrome 谷歌浏览器&lt;/a&gt;、&lt;a href=&quot;https://www.iplaysoft.com/firefox.html&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;FireFox&lt;/a&gt;&amp;nbsp;似乎都能直接实现硬解播放。&lt;/p&gt;&lt;p&gt;&lt;img class=&quot;aligncenter size-medium&quot; src=&quot;https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/8k_japan.jpg&quot; srcset=&quot;https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/8k_japan.jpg 1x,https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/8k_japan_2x.jpg 2x&quot; alt=&quot;8K高清视频&quot; width=&quot;680&quot; height=&quot;382&quot; style=&quot;text-align: center;&quot;&gt;&lt;/p&gt;&lt;p&gt;在手机上测试，&lt;a href=&quot;https://www.iplaysoft.com/go/iphone&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;iPhone X&lt;/a&gt;&amp;nbsp;使用&amp;nbsp;&lt;a href=&quot;https://www.iplaysoft.com/nplayer.html&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;nPlayer&lt;/a&gt;&amp;nbsp;通过 WiFi 无线播放&amp;nbsp;&lt;a href=&quot;https://www.iplaysoft.com/go/nas&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;NAS&lt;/a&gt;&amp;nbsp;里的视频，4K 流畅、8K 略卡顿、12K 闪退，应该是播放器未对高分辨率做适配，因时间关系未对其他 APP 进行测试。感兴趣的同学可以试试看哪款手机、哪款 APP 可以流畅播放 12K 视频吧。&lt;/p&gt;&lt;p&gt;&lt;img class=&quot;aligncenter size-medium&quot; src=&quot;https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/4k_canada.jpg&quot; srcset=&quot;https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/4k_canada.jpg 1x,https://img.iplaysoft.com/wp-content/uploads/2018/4k-8k-12k-video/4k_canada_2x.jpg 2x&quot; alt=&quot;4K 加拿大高清风景视频&quot; width=&quot;680&quot; height=&quot;340&quot; style=&quot;text-align: center;&quot;&gt;&lt;/p&gt;&lt;h3&gt;12K、8K、4K 视频包括：&lt;/h3&gt;&lt;ul&gt;&lt;li&gt;12K 纽约曼哈顿&lt;/li&gt;&lt;li&gt;12K 纽约上空&lt;/li&gt;&lt;li&gt;8K 日本风光&lt;/li&gt;&lt;li&gt;5K 美国亚利桑那&lt;/li&gt;&lt;li&gt;4K 美国拉斯维加斯&lt;/li&gt;&lt;li&gt;4K 加拿大&lt;/li&gt;&lt;li&gt;4K 伊斯坦布尔&lt;/li&gt;&lt;/ul&gt;&lt;h3&gt;8K 高清视频预览&lt;/h3&gt;&lt;p&gt;下面给出一个在线预览的 8K 日本风景视频，要注意的是，这个纯粹是让你提前了解下视频的内容。因为在线版大大缩减了分辨率，只有渣画质，与「高清」毫无关系。&lt;span&gt;要看真实效果必须下载回去播放&lt;/span&gt;，这里仅供你预览。&lt;/p&gt;&lt;div class=&quot;post-video&quot; id=&quot;post-video-0&quot;&gt;&lt;div class=&quot;post-video-image&quot; id=&quot;post-video-image-0&quot;&gt;&lt;/div&gt;&lt;div class=&quot;post-video-loader&quot; style=&quot;text-align: center;&quot;&gt;&lt;div class=&quot;post-video-loader-icon ipsicon ipsicon-play&quot;&gt;&lt;/div&gt;&lt;div&gt;点击开始播放视频&lt;/div&gt;&lt;/div&gt;&lt;a class=&quot;post-video-loader-link&quot; rel=&quot;nofollow&quot;&gt;&lt;/a&gt;&lt;/div&gt;&lt;h3&gt;写在后面：&lt;/h3&gt;&lt;p&gt;无论是用于测试设备的播放&lt;a href=&quot;https://www.iplaysoft.com/tag/%E6%80%A7%E8%83%BD&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;性能&lt;/a&gt;，还是用来做店面的演示，这些超高清的风景视频都是极好的&lt;a href=&quot;https://www.iplaysoft.com/tag/%E7%B4%A0%E6%9D%90&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;素材&lt;/a&gt;！既安静唯美，又拥有惊人的清晰效果。&lt;/p&gt;&lt;p&gt;虽然现在 4K 片源的&lt;a href=&quot;https://www.iplaysoft.com/tag/%E7%94%B5%E5%BD%B1&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;电影&lt;/a&gt;和视频已经很多了，但想要更高的 8K 甚至 12K 的视频还比较少。如果你也喜欢收藏这些高清的风光&lt;a href=&quot;https://www.iplaysoft.com/tag/%E6%91%84%E5%BD%B1&quot; target=&quot;_blank&quot; rel=&quot;noopener&quot;&gt;摄影&lt;/a&gt;视频，不妨下载回去看看吧。&lt;/p&gt;', '6', '1');
INSERT INTO `xman_article` VALUES ('13', '经典模块化前端框架', '5', '&lt;div class=&quot;site-banner&quot; style=&quot;text-align: center;&quot;&gt;&lt;div class=&quot;site-banner-main&quot;&gt;&lt;div class=&quot;layui-anim site-desc site-desc-anim&quot;&gt;&lt;p class=&quot;web-font-desc&quot;&gt;经典模块化前端框架&lt;/p&gt;&lt;cite&gt;由职业前端倾情打造，面向所有层次的前后端开发者，零门槛开箱即用的前端UI解决方案&lt;/cite&gt;&lt;/div&gt;&lt;div class=&quot;site-download&quot;&gt;&lt;a href=&quot;https://res.layui.com/static/download/layui/layui-v2.4.3.zip&quot; class=&quot;layui-inline site-down&quot; target=&quot;_blank&quot;&gt;&lt;cite class=&quot;layui-icon&quot;&gt;&lt;/cite&gt;立即下载&lt;/a&gt;&lt;/div&gt;&lt;div class=&quot;site-version&quot;&gt;&lt;span&gt;当前版本：&lt;cite class=&quot;site-showv&quot;&gt;2.4.3&lt;/cite&gt;&lt;/span&gt;&amp;nbsp;&lt;span&gt;&lt;a href=&quot;https://www.layui.com/doc/base/changelog.html&quot; rel=&quot;nofollow&quot; target=&quot;_blank&quot;&gt;更新日志&lt;/a&gt;&lt;/span&gt;&amp;nbsp;&lt;span&gt;下载量：&lt;span class=&quot;site-showdowns&quot;&gt;684075&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div class=&quot;site-banner-other&quot;&gt;&lt;a href=&quot;https://github.com/sentsin/layui/&quot; target=&quot;_blank&quot; class=&quot;site-star&quot;&gt;&lt;span class=&quot;layui-icon&quot;&gt;&lt;/span&gt;&amp;nbsp;Star&amp;nbsp;&lt;cite id=&quot;getStars&quot;&gt;14858&lt;/cite&gt;&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;https://github.com/sentsin/layui/network/members&quot; target=&quot;_blank&quot; rel=&quot;nofollow&quot; class=&quot;site-fork&quot;&gt;&lt;span class=&quot;layui-icon&quot;&gt;&lt;/span&gt;&amp;nbsp;Fork&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;https://gitee.com/sentsin/layui&quot; target=&quot;_blank&quot; rel=&quot;nofollow&quot; class=&quot;site-fork&quot;&gt;码云&lt;/a&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;div class=&quot;layui-main&quot;&gt;&lt;ul class=&quot;site-idea&quot; style=&quot;text-align: center;&quot;&gt;&lt;li style=&quot;text-align: left;&quot;&gt;&lt;fieldset class=&quot;layui-elem-field layui-field-title&quot;&gt;&lt;legend style=&quot;text-align: center;&quot;&gt;返璞归真&lt;/legend&gt;&lt;p&gt;身处在前端社区的繁荣之下，我们都在有意或无意地追逐。而 layui 偏偏回望当初，奔赴在返璞归真的漫漫征途，自信并勇敢着，追寻于原生态的书写指令，试图以最简单的方式诠释高效。&lt;/p&gt;&lt;/fieldset&gt;&lt;/li&gt;&amp;nbsp;&lt;li style=&quot;text-align: left;&quot;&gt;&lt;fieldset class=&quot;layui-elem-field layui-field-title&quot;&gt;&lt;legend style=&quot;text-align: center;&quot;&gt;双面体验&lt;/legend&gt;&lt;p&gt;拥有双面的不仅是人生，还有 layui。一面极简，一面丰盈。极简是视觉所见的外在，是开发所念的简易。丰盈是倾情雕琢的内在，是信手拈来的承诺。一切本应如此，简而全，双重体验。&lt;/p&gt;&lt;/fieldset&gt;&lt;/li&gt;&amp;nbsp;&lt;li style=&quot;text-align: left;&quot;&gt;&lt;fieldset class=&quot;layui-elem-field layui-field-title&quot;&gt;&lt;legend style=&quot;text-align: center;&quot;&gt;星辰大海&lt;/legend&gt;&lt;p&gt;如果眼下还是一团零星之火，那运筹帷幄之后，迎面东风，就是一场烈焰燎原吧，那必定会是一番尽情的燃烧。待，秋风萧瑟时，散作满天星辰，你看那四季轮回，正是 layui 不灭的执念。&lt;/p&gt;&lt;/fieldset&gt;&lt;/li&gt;&lt;/ul&gt;&lt;/div&gt;&lt;div class=&quot;layui-footer footer footer-index&quot; style=&quot;text-align: center;&quot;&gt;&lt;div class=&quot;layui-main&quot;&gt;&lt;p&gt;© 2018&amp;nbsp;&lt;a href=&quot;https://www.layui.com/&quot;&gt;layui.com&lt;/a&gt;&amp;nbsp;MIT license&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;http://fly.layui.com/case/2018/&quot; target=&quot;_blank&quot;&gt;案例&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;http://fly.layui.com/jie/3147/&quot; target=&quot;_blank&quot;&gt;支持&lt;/a&gt;&amp;nbsp;&lt;a site-event=&quot;contactInfo&quot;&gt;联系&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;https://github.com/sentsin/layui/&quot; target=&quot;_blank&quot; rel=&quot;nofollow&quot;&gt;GitHub&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;https://gitee.com/sentsin/layui&quot; target=&quot;_blank&quot; rel=&quot;nofollow&quot;&gt;码云&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;http://fly.layui.com/jie/2461/&quot; target=&quot;_blank&quot;&gt;微信公众号&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;http://www.miitbeian.gov.cn/&quot; target=&quot;_blank&quot; rel=&quot;nofollow&quot;&gt;赣ICP备13006272号-2&lt;/a&gt;&lt;/p&gt;&lt;p class=&quot;site-union&quot;&gt;&lt;a href=&quot;https://www.upyun.com/?from=layui&quot; target=&quot;_blank&quot; rel=&quot;nofollow&quot; upyun=&quot;&quot;&gt;&lt;img src=&quot;https://res.layui.com/static/images/other/upyun.png?t=1&quot;&gt;&lt;/a&gt;&amp;nbsp;&lt;span&gt;提供 CDN 赞助&lt;/span&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;', '8', '1');
INSERT INTO `xman_article` VALUES ('14', '秦始皇', '6', '&lt;div class=&quot;para&quot; label-module=&quot;para&quot;&gt;&lt;span&gt;秦始皇&lt;/span&gt;（前259年农历十二月初三—前210年），&lt;span&gt;嬴&lt;/span&gt;姓，&lt;span&gt;赵&lt;/span&gt;氏，名&lt;span&gt;政&lt;/span&gt;，又名&lt;span&gt;赵正&lt;/span&gt;（政）、&lt;span&gt;秦政&lt;/span&gt;，或称&lt;span&gt;祖龙&lt;span class=&quot;sup--normal&quot; data-sup=&quot;1-2&quot;&gt;&amp;nbsp;[1-2]&lt;/span&gt;&lt;a class=&quot;sup-anchor&quot; name=&quot;ref_[1-2]_5397432&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;&lt;/span&gt;&lt;span&gt;&lt;/span&gt;，&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E7%A7%A6%E5%BA%84%E8%A5%84%E7%8E%8B/6500378&quot; data-lemmaid=&quot;6500378&quot;&gt;秦庄襄王&lt;/a&gt;之子。&lt;span class=&quot;sup--normal&quot; data-sup=&quot;3&quot;&gt;&amp;nbsp;[3]&lt;/span&gt;&lt;a class=&quot;sup-anchor&quot; name=&quot;ref_[3]_5397432&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;中国历史上著名的&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E6%94%BF%E6%B2%BB%E5%AE%B6&quot;&gt;政治家&lt;/a&gt;、&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E6%88%98%E7%95%A5%E5%AE%B6/1242707&quot; data-lemmaid=&quot;1242707&quot;&gt;战略家&lt;/a&gt;、&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E6%94%B9%E9%9D%A9%E5%AE%B6/7239695&quot; data-lemmaid=&quot;7239695&quot;&gt;改革家&lt;/a&gt;，完成&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%8D%8E%E5%A4%8F/5823&quot; data-lemmaid=&quot;5823&quot;&gt;华夏&lt;/a&gt;大一统的铁腕政治人物，也是中国第一个称皇帝的君主。&lt;span class=&quot;sup--normal&quot; data-sup=&quot;4&quot;&gt;&amp;nbsp;[4]&lt;/span&gt;&lt;a class=&quot;sup-anchor&quot; name=&quot;ref_[4]_5397432&quot;&gt;&amp;nbsp;&lt;/a&gt;&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot;&gt;秦始皇是出生于&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E8%B5%B5%E5%9B%BD/1641&quot; data-lemmaid=&quot;1641&quot;&gt;赵国&lt;/a&gt;都城&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E9%82%AF%E9%83%B8/334665&quot; data-lemmaid=&quot;334665&quot;&gt;邯郸&lt;/a&gt;（今&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E9%82%AF%E9%83%B8/334665&quot; data-lemmaid=&quot;334665&quot;&gt;邯郸&lt;/a&gt;），并在此度过了少年时期。前247年，13岁时即王位。&lt;span class=&quot;sup--normal&quot; data-sup=&quot;5&quot;&gt;&amp;nbsp;[5]&lt;/span&gt;&lt;a class=&quot;sup-anchor&quot; name=&quot;ref_[5]_5397432&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;前238年，22岁时，在故都&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E9%9B%8D%E5%9F%8E&quot;&gt;雍城&lt;/a&gt;举行了国君成人加冕仪式，开始“亲理朝政”，除掉&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%90%95%E4%B8%8D%E9%9F%A6/593525&quot; data-lemmaid=&quot;593525&quot;&gt;吕不韦&lt;/a&gt;、&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%AB%AA%E6%AF%90/533294&quot; data-lemmaid=&quot;533294&quot;&gt;嫪毐&lt;/a&gt;等人，&lt;span class=&quot;sup--normal&quot; data-sup=&quot;6&quot;&gt;&amp;nbsp;[6]&lt;/span&gt;&lt;a class=&quot;sup-anchor&quot; name=&quot;ref_[6]_5397432&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;重用&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E6%9D%8E%E6%96%AF/1322&quot; data-lemmaid=&quot;1322&quot;&gt;李斯&lt;/a&gt;、&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%B0%89%E7%BC%AD/978068&quot; data-lemmaid=&quot;978068&quot;&gt;尉缭&lt;/a&gt;，自前230年至前221年，先后灭韩、赵、魏、楚、燕、齐六国，39岁时完成了统一中国大业，建立起一个以&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E6%B1%89%E6%97%8F/130605&quot; data-lemmaid=&quot;130605&quot;&gt;汉族&lt;/a&gt;为主体统一的中央集权的强大国家——&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E7%A7%A6%E6%9C%9D/195083&quot; data-lemmaid=&quot;195083&quot;&gt;秦朝&lt;/a&gt;，并奠定&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E4%B8%AD%E5%9B%BD%E6%9C%AC%E5%9C%9F/11029068&quot; data-lemmaid=&quot;11029068&quot;&gt;中国本土&lt;/a&gt;的疆域。&lt;span class=&quot;sup--normal&quot; data-sup=&quot;4&quot;&gt;&amp;nbsp;[4]&lt;/span&gt;&lt;a class=&quot;sup-anchor&quot; name=&quot;ref_[4]_5397432&quot;&gt;&amp;nbsp;&lt;/a&gt;&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot;&gt;秦始皇认为自己的&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%8A%9F%E5%8A%B3/11046219&quot; data-lemmaid=&quot;11046219&quot;&gt;功劳&lt;/a&gt;胜过之前的&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E4%B8%89%E7%9A%87%E4%BA%94%E5%B8%9D/138427&quot; data-lemmaid=&quot;138427&quot;&gt;三皇五帝&lt;/a&gt;，采用&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E4%B8%89%E7%9A%87/1643592&quot; data-lemmaid=&quot;1643592&quot;&gt;三皇&lt;/a&gt;之“皇”、&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E4%BA%94%E5%B8%9D/362094&quot; data-lemmaid=&quot;362094&quot;&gt;五帝&lt;/a&gt;之“帝”构成“皇帝”的称号，&lt;span class=&quot;sup--normal&quot; data-sup=&quot;7&quot;&gt;&amp;nbsp;[7]&lt;/span&gt;&lt;a class=&quot;sup-anchor&quot; name=&quot;ref_[7]_5397432&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;是中国历史上第一个使用“皇帝”称号的君主，所以自称“始皇帝”。同时在中央实行&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E4%B8%89%E5%85%AC%E4%B9%9D%E5%8D%BF/905905&quot; data-lemmaid=&quot;905905&quot;&gt;三公九卿&lt;/a&gt;，管理国家大事。地方上废除&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%88%86%E5%B0%81%E5%88%B6/755093&quot; data-lemmaid=&quot;755093&quot;&gt;分封制&lt;/a&gt;，代以&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E9%83%A1%E5%8E%BF%E5%88%B6/1859555&quot; data-lemmaid=&quot;1859555&quot;&gt;郡县制&lt;/a&gt;，同时&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E4%B9%A6%E5%90%8C%E6%96%87/858625&quot; data-lemmaid=&quot;858625&quot;&gt;书同文&lt;/a&gt;，&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E8%BD%A6%E5%90%8C%E8%BD%A8/858511&quot; data-lemmaid=&quot;858511&quot;&gt;车同轨&lt;/a&gt;，统一&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%BA%A6%E9%87%8F%E8%A1%A1&quot;&gt;度量衡&lt;/a&gt;。对外北击&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%8C%88%E5%A5%B4/294798&quot; data-lemmaid=&quot;294798&quot;&gt;匈奴&lt;/a&gt;，南征&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E7%99%BE%E8%B6%8A/1979157&quot; data-lemmaid=&quot;1979157&quot;&gt;百越&lt;/a&gt;，修筑&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E4%B8%87%E9%87%8C%E9%95%BF%E5%9F%8E/35257&quot; data-lemmaid=&quot;35257&quot;&gt;万里长城&lt;/a&gt;，修筑&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E7%81%B5%E6%B8%A0/599313&quot; data-lemmaid=&quot;599313&quot;&gt;灵渠&lt;/a&gt;，沟通水系。&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot;&gt;但是到了后期，求仙梦想长生，苛政虐民，扼杀民&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E6%99%BA/13680607&quot; data-lemmaid=&quot;13680607&quot;&gt;智&lt;/a&gt;，动摇了秦朝统治的根基，前210年，&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E7%A7%A6%E5%A7%8B%E7%9A%87%E4%B8%9C%E5%B7%A1&quot;&gt;秦始皇东巡&lt;/a&gt;途中驾崩于&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E9%82%A2%E5%8F%B0/264966&quot; data-lemmaid=&quot;264966&quot;&gt;邢台&lt;/a&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E6%B2%99%E4%B8%98/8511221&quot; data-lemmaid=&quot;8511221&quot;&gt;沙丘&lt;/a&gt;。&lt;span class=&quot;sup--normal&quot; data-sup=&quot;8&quot;&gt;&amp;nbsp;[8]&lt;/span&gt;&lt;a class=&quot;sup-anchor&quot; name=&quot;ref_[8]_5397432&quot;&gt;&amp;nbsp;&lt;/a&gt;&lt;/div&gt;&lt;div class=&quot;para&quot; label-module=&quot;para&quot;&gt;秦始皇是中国历史上一位叱咤风云富有传奇色彩的划时代人物，是中国历史上第一个大一统王朝——&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E7%A7%A6%E7%8E%8B%E6%9C%9D/8932675&quot; data-lemmaid=&quot;8932675&quot;&gt;秦王朝&lt;/a&gt;的开国皇帝，对中国和世界历史产生深远影响，把中国推向&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%A4%A7%E4%B8%80%E7%BB%9F/5485731&quot; data-lemmaid=&quot;5485731&quot;&gt;大一统&lt;/a&gt;时代，奠定中国两千余年&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E6%94%BF%E6%B2%BB%E5%88%B6%E5%BA%A6/2135182&quot; data-lemmaid=&quot;2135182&quot;&gt;政治制度&lt;/a&gt;基本格局，被明代思想家&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E6%9D%8E%E8%B4%BD/478732&quot; data-lemmaid=&quot;478732&quot;&gt;李贽&lt;/a&gt;誉为“&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%8D%83%E5%8F%A4%E4%B8%80%E5%B8%9D/33644&quot; data-lemmaid=&quot;33644&quot;&gt;千古一帝&lt;/a&gt;”&lt;span class=&quot;sup--normal&quot; data-sup=&quot;9&quot;&gt;&amp;nbsp;[9]&lt;/span&gt;&lt;a class=&quot;sup-anchor&quot; name=&quot;ref_[9]_5397432&quot;&gt;&amp;nbsp;&lt;/a&gt;&amp;nbsp;。&lt;span class=&quot;sup--normal&quot; data-sup=&quot;4&quot;&gt;&amp;nbsp;[4]&lt;/span&gt;&lt;a class=&quot;sup-anchor&quot; name=&quot;ref_[4]_5397432&quot;&gt;&amp;nbsp;&lt;/a&gt;&lt;/div&gt;', '10', '0');
