CREATE TABLE `xman_test_test` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `tilte` varchar(255) NOT NULL COMMENT '文章名',
  `addtime` datetime NOT NULL COMMENT '添加时间',
  `image` varchar(255) NOT NULL COMMENT '头图',
  `content` text COMMENT '内容',
  `category` enum('0','1','2') DEFAULT '0' COMMENT '分类:0=历史,1=政治,2=新闻',
  `switch` tinyint(1) DEFAULT '1' COMMENT '是否展示:0=隐藏,1=展示',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;

